import React from "react";
import TopBar from "../top-bar/topBar";
import FloatMenu from "../float-menu/floatMenu";
import Menu from "../menuDisplay/menuDisplay";

export default function Main(){
    return(
        <View>
            <TopBar></TopBar>
            <Menu></Menu>
            <FloatMenu></FloatMenu>
        </View>
    )
}
